#https://www.interviewbit.com/problems/rotated-array/

# Suppose a sorted array A is rotated at some pivot unknown to you beforehand.
# (i.e., 1 2 4 5 6 7 might become 4 5 6 7 1 2).

# Find the minimum element.
# The array will not contain duplicates.
# Note:- Use the circular rotated property of the array to solve the problem.

class Solution:
    # @param A : tuple of integers
    # @return an integer
    def findMin(self, A):
        if len(A)==1:
            return A[0]
        start = 0
        end = len(A)-1
        minNum = A[0]
        
        # result = []
        # for i, num in enumerate(A):
        #     # print(i)
        #     if i==len(A)-1:
        #         break
        #     if A[i+1]-A[i] < 0:
        #         result.append(i)
        
        # return result
        
        count = 0
        while start<=end:
            
            
            mid = (start+end)//2
            print(start, mid, end)
            print(" => ", A[start], A[mid], A[end])
            count += 1
            if count == 20:
                break
            minNum = min(minNum, A[mid])
            if A[mid] > A[end]:
                start = mid+1
            elif A[start] > A[mid]:
                end = mid-1
                continue
            
                
        return min(A[start], A[end], A[mid])
    
    def findMin2(self, A):
        if len(A)==1:
            return A[0]
        start = 0
        end = len(A)-1
        
        while start<=end:
            
            mid = (start+end)//2
            # print(start, mid, end)
            # print(" => ", A[start], A[mid], A[end])

            if((mid == 0 or A[mid] < A[mid-1]) and (mid == len(A)-1 or A[mid] < A[mid+1])):
                return A[mid]
            elif A[mid] > A[end]:
                start = mid+1
            else:
                end = mid-1
            
                
        return -1

